	var endIndex = emailTitle.IndexOf(tag, startIndex);
	if(startIndex == -1 || endIndex == -1)
	{
		return String.Empty;
	}
	caseIdFromServiceDesk = emailTitle.Substring(startIndex, endIndex - startIndex);
	return caseIdFromServiceDesk;
}

