public static string GetTextByTitle(string content, string title, string[] separator, string endTitle, string[] textSeparator, int word)
{
	var textByTitle = String.Empty;
	var startIndex = content.IndexOf(title);
	if(startIndex == -1)
	{
		return String.Empty;
	}
	var endIndex = content.IndexOf(endTitle, startIndex);
	if(startIndex == -1 || endIndex == -1)
	{
		return String.Empty;
	}
	var splitedText = content.Substring(startIndex, (endIndex - startIndex)).Split(separator,StringSplitOptions.RemoveEmptyEntries);
	if(splitedText.Length < 2)
	{
		return String.Empty;
	}
	try
	{
		var splittedSecondPart = splitedText[1].Split(textSeparator, StringSplitOptions.RemoveEmptyEntries);
		return splittedSecondPart[word].Trim();
	}
	catch(Exception ex)
	{
		return String.Empty;
	}
	return splitedText[1].Trim();
}

