        return Guid.Empty;
    }
    var lookupBPMId = (new Select(userConnection).Top(1)
        .Column(columnReturn)
        .From(table)
        .Where(column).IsEqual(Terrasoft.Core.DB.Column.Parameter(value)) as Select).ExecuteScalar<Guid>();
    return lookupBPMId;
}
